        bytes32[10] webserverip;
        // the create timestamp of the Organization
        // 记录公司与组织的创建时间
        uint32 createtimestamp;
        // 如果门户违反行为准则,进行冻结限制
        bool marketunlock;
        // config by the gater
        bool unlock;
        bool isUsed;
    }
}

